import React, { Component } from "react";
import "./App.css";
import NavBar from "./Components/NavBar";

export default function App() {
  this.state = {
    count: 0,
  };

  return (
    <div>
      <NavBar />
      <div>
        {this.state.count}
        <button
          onClick={() => {
            setState({
              count: this.state.count + 1,
            });
          }}
        >
          Get Request
        </button>
      </div>
    </div>
  );
}

